import React from 'react'

const Avatar = ({children,backgroundColor,
  padding,
  color,
  borderRadius,
  fontSize,
  textAlign}) => {
  const style ={
    backgroundColor,
    padding,
    color,
    borderRadius,
    fontSize,
    textAlign
  }
  return (
    <div style={style}>
       { children }
    </div>
  )
}

export default Avatar
